import numpy as np
import matplotlib.pyplot as plt
from Bio.pairwise2 import align
import enum

BACKGROUND = 'B'
MOTIF = 'M'
MOTIF_MIN_LEN = 1
FOUND_REGIONS_LOC = 0
EXPECTED_REGIONS_LOC = 1
MATCH_PERCENT_LOC = 2
PROTEIN_LENGTH_LOC = 3
FALSE_POS_LOC = 4
FALSE_NEG_LOC = 5
POS_LOC = 6
NEG_LOC = 7
NUMBER_OF_PARAMS = 8


class Grouping(enum.Enum):
    LENGTH = 1
    MOTIFS = 2


def split(word):
    return [char for char in word]


class resultsCompare:
    def __init__(self):
        self.false_pos = 0
        self.false_neg = 0
        self.pos = 0
        self.neg = 0
        pass

    def combine_sames(self, results, grouping_type):
        tested = 0
        results_dict = {}
        if grouping_type == Grouping.MOTIFS:
            tested = EXPECTED_REGIONS_LOC
        else:
            tested = PROTEIN_LENGTH_LOC

        for val in results:
            if val[tested] not in results_dict.keys():
                results_dict[val[tested]] = []
            results_dict[val[tested]].append(val)
        combined_results = self.combine_results_dict(results_dict)
        return combined_results

    def combine_results_dict(self, results_dict):
        combined_results = []
        for key in results_dict.keys():
            val = [0] * NUMBER_OF_PARAMS
            for i in results_dict[key]:
                for j in range(NUMBER_OF_PARAMS):
                    val[j] += i[j]
            for j in range(NUMBER_OF_PARAMS):
                val[j] = val[j] / len(results_dict[key])
            combined_results.append(val)
        return combined_results

    def plot_results_by(self, results, grouping_type):
        vals = np.array(results).T
        # self.display_number_of_motifs_diff_grouped(vals, grouping_type)
        # self.display_match_perc_by_grouped(vals, grouping_type)
        # self.plot_value_after_grouping(grouping_type, results, FALSE_POS_LOC, "false positive")
        # self.plot_value_normalized_after_grouping(grouping_type, results, FALSE_POS_LOC, "false positive relative")

        # for val in results:
        #     print(val[4:8])

        self.plot_confusion_matrix(self.false_neg, self.false_pos, self.neg, self.pos)

    def plot_confusion_matrix(self, false_neg, false_pos, neg, pos):
        plt.axis('off')
        self.draw_matrix_titles()

        self.draw_matrix_values(false_neg, false_pos, neg, pos)
        self.draw_matrix_lines()
        plt.show()

    def draw_matrix_values(self, false_neg, false_pos, neg, pos):
        plt.text(0.9, 0.65, neg - false_neg + false_pos, fontsize=16)
        plt.text(0.9, 0.3, false_neg + pos - false_pos, fontsize=18)
        plt.text(0.65, 0.05, pos, fontsize=16)
        plt.text(0.32, 0.05, neg, fontsize=16)
        plt.text(0.28, 0.3, "FN=" + str(false_neg), fontsize=16)
        plt.text(0.62, 0.3, "TP=" + str(pos - false_pos), fontsize=16)
        plt.text(0.27, 0.65, "TN=" + str(neg - false_neg), fontsize=16)
        plt.text(0.62, 0.65, "FP=" + str(false_pos), fontsize=16)

    def draw_matrix_titles(self):
        plt.text(0.57, 0.9, "Predicted Yes", fontsize=16)
        plt.text(0.25, 0.9, "Predicted No", fontsize=16)
        plt.text(0.0, 0.3, "Actual Yes", fontsize=16)
        plt.text(0.0, 0.65, "Actual No", fontsize=16)

    def draw_matrix_lines(self):
        x1, y1 = [-0.01, 1], [0.12, 0.12]
        plt.plot(x1, y1, color='blue')
        x3, y3 = [-0.01, 1], [0.5, 0.5]
        plt.plot(x3, y3, color='blue')
        x3, y3 = [-0.01, 1], [0.85, 0.85]
        plt.plot(x3, y3, color='blue')
        x3, y3 = [0.55, 0.55], [1, 0]
        plt.plot(x3, y3, color='blue')
        x3, y3 = [0.22, 0.22], [1, 0]
        plt.plot(x3, y3, color='blue')
        x3, y3 = [0.87, 0.87], [1, 0]
        plt.plot(x3, y3, color='blue')

    def plot_value_normalized_after_grouping(self, grouping_type, results, plotted_value, plotted_title):
        results = self.combine_sames(results, grouping_type)
        vals = np.array(results).T
        tested = 0
        if grouping_type == Grouping.MOTIFS:
            tested = EXPECTED_REGIONS_LOC
        else:
            tested = PROTEIN_LENGTH_LOC
        plt.plot(vals[tested], vals[plotted_value] / vals[PROTEIN_LENGTH_LOC])
        title, x_title, y_title = self.create_labels(grouping_type, plotted_title)
        plt.title(title)
        plt.xlabel(x_title)
        plt.ylabel(y_title)
        plt.ylim((0, 1))
        plt.show()

    def plot_value_after_grouping(self, grouping_type, results, plotted_value, plotted_title):
        results = self.combine_sames(results, grouping_type)
        vals = np.array(results).T
        tested = 0
        if grouping_type == Grouping.MOTIFS:
            tested = EXPECTED_REGIONS_LOC
        else:
            tested = PROTEIN_LENGTH_LOC
        plt.plot(vals[tested], vals[plotted_value])
        title, x_title, y_title = self.create_labels(grouping_type, plotted_title)
        plt.title(title)
        plt.xlabel(x_title)
        plt.ylabel(y_title)
        if plotted_value == MATCH_PERCENT_LOC:
            plt.ylim((0, 1))
        plt.show()

    def create_labels(self, grouping_type, plotted_title):
        title = plotted_title + " By "
        x_title = ""
        y_title = plotted_title
        if grouping_type == Grouping.MOTIFS:
            title += "Number of Motifs"
            x_title = "Number of Motifs"
        elif grouping_type == Grouping.LENGTH:
            title += "Protein length"
            x_title += "Protein length"
        return title, x_title, y_title

    def display_number_of_motifs_diff_grouped(self, vals, grouping_type):
        group = self.get_group_string(grouping_type)

        region_num_diff = np.abs(vals[0, :] - vals[1, :])
        fig1, ax1 = plt.subplots()

        ax1.set_title('Difference in Number of Motifs grouped by' + group)
        chunk_size = int(region_num_diff.shape[0] / 5)
        ax1.boxplot(list(chunks(np.array(region_num_diff), chunk_size)))
        plt.xlabel(group + " group")
        plt.ylabel("Difference in Number of Motifs")

        plt.show()

    def get_group_string(self, grouping_type):
        group = ""
        if grouping_type == Grouping.LENGTH:
            group = "Length"
        elif grouping_type == Grouping.MOTIFS:
            group = "Motifs"
        return group

    def display_match_perc_by_grouped(self, vals, grouping_type):
        group = self.get_group_string(grouping_type)
        region_num_diff = np.abs(vals[2, :] * 100)
        fig1, ax1 = plt.subplots()
        ax1.set_title('Motif Match Accuracy  grouped by' + group)
        chunk_size = int(region_num_diff.shape[0] / 5)
        ax1.boxplot(list(chunks(np.array(region_num_diff), chunk_size)))
        plt.xlabel(group + " group")
        plt.ylabel("Match Percent")
        plt.show()

    def compare_found_expected(self, found, expected):
        found_regions_count = self.find_region_count(found)
        expected_regions_count = self.find_region_count(expected)
        match_percent, fp, fn, pos, neg = self.match_strings(expected, found)
        self.false_pos += fp
        self.false_neg += fn
        self.pos += pos
        self.neg += neg
        return (found_regions_count, expected_regions_count, match_percent, len(expected), fp, fn, pos, neg)

    def match_strings(self, expected, found):
        match_count = 0
        max_len = max(len(expected), len(found))  # len should be the same at most cases
        min_len = min(len(expected), len(found))
        pos = 0
        fp = 0
        neg = 0
        fn = 0
        for i in range(min_len):
            if found[i] == MOTIF:
                pos += 1
            else:
                neg += 1
            if found[i] == expected[i]:
                match_count += 1
            else:
                if found[i] == MOTIF:
                    fp += 1
                else:
                    fn += 1
        return (match_count / max_len, fp, fn, pos, neg)

    def find_region_count(self, tested_seq):
        curr_letter = tested_seq[0]
        sizable_region_count = 0
        region_len = 0
        for i in range(len(tested_seq)):
            if tested_seq[i] == curr_letter:
                if curr_letter == MOTIF:
                    region_len += 1
                continue
            curr_letter = tested_seq[i]
            if curr_letter == BACKGROUND and region_len >= MOTIF_MIN_LEN:
                sizable_region_count += 1
            region_len = 0
        return sizable_region_count

    def seq_alignment(self, seq1, seq2):
        return align.globalxx(seq1, seq2, score_only=True, penalize_end_gaps=True, penalize_extend_when_opening=True)


def seq_compare(x, y):
    return len(x[0]) - len(y[0])


def chunks(lst, n):
    """Yield successive n-sized chunks from lst."""
    for i in range(0, len(lst), n):
        yield lst[i:i + n]


